// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.7;


contract Bank{
    mapping( address => uint) balance;
    uint userCount;
    address owner;
    constructor() payable{
        require(msg.value == 15 ether, 'Initial 15 ether required for contract to run');
        owner=msg.sender;
    }
    function openAccount(address accountOpener) public payable {
        if(userCount<=3){
            balance[msg.sender]= 15 ether;
        }
    }
}

